import React from 'react';

const Match = () => {
    return (
        <div class="matched-container">
            <h1 class="text-center pt-5">You got a new match!</h1>
            <a href="/">
                <button type="button" class="btn btn-primary">Continue Swiping</button>
            </a>
            <a href="/matches">
                <button type="button" class="btn btn-primary">Go to Chat</button>
            </a>
        </div>
    );
};

export default Match;
